public void testInjectedDiscountService_test4_decomposed()  {
    DiscountService customService = new DiscountService()
        .withDiscount(DiscountService.DiscountType.FIXED_AMOUNT, 20.0);
    ShoppingCart customCart = new ShoppingCart(customService);
    customCart.addItem(new CartItem("Item", 50.0, 1));
    assertEquals(20.0, customCart.getDiscountAmount());
    assertEquals(30.0, customCart.getTotal());
}

