public void testClear_test5_decomposed()  {
    cart.addItem(new CartItem("Apple", 1.0, 2));
    cart.getDiscountService();
    cart.getDiscountService().withDiscount(DiscountService.DiscountType.VIP, 0);
    cart.clear();
    assertTrue(cart.isEmpty());
    assertFalse(cart.hasDiscount());
}

